import React, { useEffect, useState } from "react";
import PropTypes from "prop-types";

function CommitList({ repoName }) {
  const [commits, setCommits] = useState([]);

  useEffect(() => {
    fetch(`https://api.github.com/repos/Netflix/${repoName}/commits`)
      .then((response) => response.json())
      .then((data) => console.log(data))
      .then((data) => setCommits(data))
      .catch((error) => console.log(error));
  }, [repoName]);

  return (
    <div>
      <h2>Commits for {repoName}</h2>
      <ul>
        {commits.map((commit) => (
          <li key={commit.sha}>
            <p>Commit message: {commit.commit.message}</p>
            <p>Committer username: {commit.commit.committer.name}</p>
            <p>Commit hash: {commit.sha}</p>
            <p>Date created: {commit.commit.committer.date}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

CommitList.propTypes = {
  repoName: PropTypes.string,
};

export default CommitList;
